import React from 'react';
import NewsSlider from '../../../Widgets/NewsSlider';

const NewsMain = () => {
    return (
        <div>
            <NewsSlider
                type="featured"
                settings={{dots:false}}
                />

        </div>
    );
};

export default NewsMain;
